import axios from "axios";
import React, { useEffect, useState } from "react";

const Inicio = () => {
  const [data, setdata] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const respuesta = await axios.get("http://localhost:3000/users");
        setdata(respuesta.data);
      } catch (error) {
        console.error("Error no trae los datos data:", error);
      }
    };
    fetchData();
  }, []);

  return (
    <div className=" box-border bg-gradient-to-r from-blue-800 to-blue-400 w-screen h-screen  ">
      <div className=" flex flex-col gap-7 h-3/6 justify-center items-center  ">
        <h1 className=" bg-clip-text text-transparent text-6xl font-extrabold bg-gradient-to-r from-pink-500 to-orange-500">
          Lista de Usuarios
        </h1>

        <table className=" table-auto bg-slate-50 w-[80%]  font-sans rounded-md p-6 shadow-2xl shadow-white opacity-1 ">
          <thead>
            <tr>
              <th>Id</th>
              <th>Nombre</th>
              <th>Edad</th>
              <th>Email</th>
              <th>Telefono</th>
              <th>Genero</th>
              <th>Ciudad</th>
            </tr>
          </thead>
          <tbody>
            {data.map((d, i) => (
              <tr key={i}>
                <td> {d.id} </td>
                <td> {d.name} </td>
                <td> {d.age} </td>
                <td> {d.email} </td>
                <td> {d.phone_number} </td>
                <td> {d.gender} </td>
                <td> {d.city} </td>
                <td>
                  <button className="">Editar</button>
                  <button className="">Borrar</button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};
export default Inicio;
